import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  IconButton,
  Typography
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import WalletsList from './WalletsList';
import useInterval from './useInterval';
var axios = require('axios');

var walletQuery = 'https://api.anchorage-development.com/v2/vaults/8fd09f37392e0faa77ab858af3ee350c/wallets';
var transactionQuery = 'https://api.anchorage-development.com/v2/transactions?walletId=f142b40293e71754a02adba22d9c1188'
var apiKey = 'faf601815e5f1c347b1ca98f4046965a9bff0302e311f2b048c2c98ffacd7947';

export default function App() {
  // const [isLoading, setLoading] = useState(true);
  const [wallets, getWallets] = useState('');
  const [transactions, setTransactions] = useState('');
  const delay = 1000;

  useEffect(() => {
    getAllWallets();
  }, []);

  useEffect(() => {
    const interval = setInterval(getAllTransactions(), delay);
    return () => clearInterval(interval);
  }, [delay])

  const getAllWallets = () => {
    axios.get(walletQuery, {
          headers: {
            'Api-Access-Key': apiKey
          }
        })
    .then((res) => {
      const allWallets = res.data.data;
      getWallets(allWallets);
    })
    .catch(err => console.log(`Error: ${err}`));
  }

  const getAllTransactions = () => {
    axios.get(transactionQuery, {
          headers: {
            'Api-Access-Key': apiKey
          }
        })
    .then((res) => {
      console.log(res.data.data);
    })
    .catch(err => console.log(`Error: ${err}`))
  }

  return (
    <div>
    <AppBar position="static">
      <Toolbar variant="dense">
        <IconButton edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" color="inherit" component="div">
          Crypto Exchange
        </Typography>
      </Toolbar>
    </AppBar>
    <WalletsList wallets={wallets}/>
    </div>
  )
};
